import { React } from "react";
import {
  BackgroundDiv,
  DivMeioTela,
  DivNavLink,
  DivSuperior,
  DivTitulo,
  SubTitulo,
  TextoBranco,
  TiraAzul,
  Titulo,
} from "./index.js";

const Login = () => {
  return (
    <BackgroundDiv>
      <DivSuperior>
        <DivTitulo>
        <DivNavLink
          to="/"
          textDecoration>
            <Titulo>{"Porco Rosso"}</Titulo>
          </DivNavLink>
          <SubTitulo>{"Pizzaria"}</SubTitulo>
        </DivTitulo>
      </DivSuperior>
      <TiraAzul>
        <TextoBranco>{"menu"}</TextoBranco>
        <TextoBranco>{"sobre nós"}</TextoBranco>
      </TiraAzul>
      <DivMeioTela>
      </DivMeioTela>
    </BackgroundDiv>
  );
};

export { Login };
